import React from 'react';
import './Style.css';

function Navbar() {
  return (
    <nav class="navbar">
      <div className='navbar-center'></div>
      <ul>
        <il>
          <button type="button" class="btn btn-light m-4">Characters</button>
          <button type="button" class="btn btn-success m-4">Watch List</button>
          <button type="button" class="btn btn-warning m-4">About</button>
        </il>
      </ul>
    </nav>
  );
}

export default Navbar;
